export default function cleanSet(set, startString) {
  if (!startString) {
    return '';
  }
  const result = [...set]
    .filter(value => value.startsWith(startString)) // First we filter elements starting with startString
    .map(value => value.substring(startString.length)) // Then we map to substring after startString
    .join('-'); // And finally we join elements with '-'

  return result;
}

